import React, { Component } from "react";
import Product from "./Product";

class ProductsTable extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    console.log(`  ProductsTable= ${this.props.productsData}`);
    return <Product productName={this.state.isLoaded && this.props.data} />;
  }
}

export default ProductsTable;
